	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1363, 'ملائمة لأي نوع من أنواع القيادة، سواءً على الطرق الممهدة أو غير الممهدة. وتناسب أية ميزانية. نقل سرعات سلس مع قيادة مريحة.', hextoraw('476BF6E7284E19448C6F86CD94141608'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1364, 'توفر هذه الدراجة مستوى عاليًا من الأداء في حدود ميزانية معينة. فهي تتميز بسرعة الاستجابة وإمكانية القيام بمناورات، هذا بالإضافة إلى إمكاناتها الفائقة التي تمنح الثقة في القيادة على الطرق غير الممهدة.', hextoraw('CAE5F3870F465641817C383EB6E6076C'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1365, 'لعاشقي قيادة الدراجات في الممرات غير الممهدة. دراجة شديدة التحمل يمكنك الانطلاق بها إلى أي مكان بما توفره لك من تحكم على الطرق الوعرة، كل هذا دون أن تتجاوز ميزانيتك.', hextoraw('470265B0EF26E94180F35ED0FA0523FA'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1366, 'لقيادة المحترفين في المناطق الريفية. دراجة مُثلى لجميع مستويات المنافسة. تستخدم نفس هيكل HL Frame المستخدم في طراز Mountain-100.', hextoraw('76D7E0432EB18542968303E18B732A7C'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1367, 'دراجة سباقات مخصصة للقيادة في الجبال من أعلى طراز. تتضمن خيارات تحسين الأداء هيكل HL Frame الإبداعي، والتعليق الأمامي ذي السلاسة الفائقة، وقوة الجر المناسبة لجميع أنواع الأراضي.', hextoraw('0F90995961DD1F40A22B36115C6853C8'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1368, 'مناسبة لجميع أنواع الرحلات على الطرق غير الممهدة. تناسب أية ميزانية.', hextoraw('62761831032E904B960D0B9C16300C4B'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1369, 'إنها دراجة مناسبة للمبتدئين من البالغين؛ فهي توفر قيادة مريحة سواءً على الطرق الوعرة أو في ساحة المدينة. يتميز محورا العجلتين وإطاريهما المعدنيين بسرعة التفكيك.', hextoraw('237D4D54F5AAD746953DC6C85E7E239D'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1370, 'إنها دراجة ذات سعر مناسب لإمكاناتها كما تتمتع بالعديد من مزايا أعلى طرازات دراجاتنا. إنها تتمتع أيضًا بما نشتهر به من هيكل خفيف وصلب، وسرعة في التسارع.', hextoraw('E9BB6C011BD5504A94CD5FF2DA577C5B'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1371, 'ولها نفس التقنية المتوفرة في جميع دراجات سلسلة الطريق لدينا، ولكن هيكل الدراجة قد تم تغيير حجمه ليناسب القيادة النسائية. إنها دراجة مثالية تصلح للعديد من الأغراض، وتناسب القيادة على الطرق العادية أو القيادة في السباقات.', hextoraw('3D6C6BE802638A4BB51769D795772A1D'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1372, 'ولها نفس التقنية المتوفرة في جميع دراجات سلسلة الطريق لدينا. إنها دراجة مثالية متعددة الأغراض، تناسب القيادة على الطرق العادية أو القيادة في السباقات.', hextoraw('5F2A4C2122EDA54E83F5D2E78C417BDC'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1373, 'إنها دراجة تصلح للعديد من الرياضات وهي مصممة لتوفير أقصى فعالية للقيادة، كما تتميز بتصميم ابتكاري. يتيح لك تصميمها الديناميكي الهوائي إمكانية القيادة مع المحترفين، حيث إنها مزودة بتروس يمكنها الانطلاق داخل الطرق المرتفعة شديدة الانحدار.', hextoraw('A20AEE7911738C448C0BAC926F68A746'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1374, 'يمكنك باستخدام هذه الدراجة الأنيقة التي تتميز بخاصية الديناميكية الهوائية التدرب على مهارات مختلفة أو التسابق أو مجرد المشاركة في نشاط اجتماعي. وتوفر لك تقنية المقاعد المتقدمة الراحة طوال اليوم.', hextoraw('C17960C45D030E49896C2CB201AAE357'), timestamp '2003-06-01 00:00:00');
	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1375, 'يمكنكِ باستخدام هذه الدراجة الأنيقة التي تتميز بخاصية الديناميكية الهوائية والمصممة للنساء التدرب على مهارات مختلفة أو التسابق أو مجرد المشاركة في نشاط اجتماعي. وتوفر لكِ تقنية المقاعد المتقدمة الراحة طوال اليوم.', hextoraw('9E199F99894FBC4EB6D42B6362785C3C'), timestamp '2003-06-01 00:00:00');
