	INSERT INTO ProductDescription (ProductDescriptionID, Description, rowguid, ModifiedDate) VALUES (1378, 'إنها دراجة قيّمة تصلح لكافة المناسبات وهي تشتمل على ميزات الراحة والأمان الأساسية في منتجاتنا. وهي تتميز بإطارات أعرض وأكثر توازنًا من غيرها بما يلائم القيادة في أرجاء البلدة أو أثناء رحلات العطلات الأسبوعية.', hextoraw('069B070BB951CB43A47C9966BF38CB68'), timestamp '2003-06-01 00:00:00');
