/*SQLPLUS*/ SET DEFINE OFF
/

CREATE OR REPLACE PACKAGE TestUtils AUTHID CURRENT_USER IS

	PROCEDURE DropTableIfExists(tableName IN varchar2);

	PROCEDURE DropSequenceIfExists(sequenceName IN varchar2);

END TestUtils;
/

CREATE OR REPLACE PACKAGE BODY TestUtils IS
	/** ORA-00942: table or view does not exist */
	TABLE_OR_VIEW_DOES_NOT_EXIST exception;
	PRAGMA EXCEPTION_INIT(TABLE_OR_VIEW_DOES_NOT_EXIST, -942);

	/** ORA-02289: sequence does not exist */
	SEQUENCE_DOES_NOT_EXIST exception;
	PRAGMA EXCEPTION_INIT(SEQUENCE_DOES_NOT_EXIST, -2289);

	PROCEDURE DropTableIfExists(tableName IN varchar2) IS
	BEGIN
		EXECUTE IMMEDIATE 'drop table ' || tableName;
	EXCEPTION
		WHEN TABLE_OR_VIEW_DOES_NOT_EXIST THEN
			null;
	END DropTableIfExists;

	PROCEDURE DropSequenceIfExists(sequenceName IN varchar2) IS
	BEGIN
		EXECUTE IMMEDIATE 'drop sequence ' || sequenceName;
	EXCEPTION
		WHEN SEQUENCE_DOES_NOT_EXIST THEN
			null;
	END DropSequenceIfExists;

END TestUtils;
/


BEGIN
	TestUtils.DropSequenceIfExists('Person_Seq');
	TestUtils.DropTableIfExists('Person');
	TestUtils.DropTableIfExists('Address');
	TestUtils.DropTableIfExists('Customer');
	TestUtils.DropTableIfExists('CustomerAddress');
	TestUtils.DropTableIfExists('Product');
	TestUtils.DropTableIfExists('ProductCategory');
	TestUtils.DropTableIfExists('ProductDescription');
	TestUtils.DropTableIfExists('ProductModel');
	TestUtils.DropTableIfExists('ProductModelProductDescription');
	TestUtils.DropTableIfExists('SalesOrderDetail');
	TestUtils.DropTableIfExists('SalesOrderHeader');
END;
